function Counter() {
    const [car, setCar] = useState(0);
    let inc = () => {
        setCar(car+1);
    }
    let dec = () => {
        setCar(car-1);
    }
    return (
        <div>
        <button style={bac} onClick={inc}><h1>+</h1></button>
        <button onClick={dec}><h1>-</h1></button>
        <h2>{car}</h2>
            </div>
    )
}

export default Counter
